import React from 'react';
import { Link } from 'react-router-dom';

const GeneralInfoSidebar = () => {
  return (
    <div className="mb-3">
      <div className="list-group">
        <Link to="#" className="list-group-item list-group-item-action active">
          Información general
        </Link>
        <Link to="#" className="list-group-item list-group-item-action">Inicio</Link>
        <Link to="#" className="list-group-item list-group-item-action">La Asociación</Link>
        <Link to="#" className="list-group-item list-group-item-action">Redes Sociales</Link>
        <Link to="#" className="list-group-item list-group-item-action">Nuestro albergue</Link>
        <Link to="#" className="list-group-item list-group-item-action">Profesionales colaboradores</Link>
        <Link to="#" className="list-group-item list-group-item-action">Contacto</Link>
        <Link to="#" className="list-group-item list-group-item-action">Calendario de google</Link>
      </div>
    </div>
  );
};

export default GeneralInfoSidebar;
